INSERT INTO `movie` VALUES (0x0106732EA83F41C88803352A86E4C81B,'How Brown Saw the Baseball Game',1907,0.0,'How Brown Saw the Baseball Game is an American short silent comedy film produced in 1907 and distributed by the Lubin Manufacturing Company. The film follows a baseball fan named Mr. Brown who drinks large quantities of alcohol before a baseball game and becomes so intoxicated that the game appears to him in reverse motion. During production, trick photography was used to achieve this effect.','https://upload.wikimedia.org/wikipedia/commons/b/b3/Howbrownsaw_Advertisement.png',211,73,'How_Brown_Saw_the_Baseball_Game'),(0x05EFF17573034555ADB0838C982B1629,'The Life of Moses',1909,0.0,'The Life of Moses is a 1909 American silent epic film directed by J. Stuart Blackton and starring Pat Hartigan, Julia Arthur and William J. Humphrey. A portrayal of the biblical story of Moses, it was one of a number of prestige film based on historical or religious subjects made during the era.','https://upload.wikimedia.org/wikipedia/commons/thumb/5/58/The-Life-of-Moses-1909.jpg/320px-The-Life-of-Moses-1909.jpg',320,246,'The_Life_of_Moses'),(0x219B792F1BBD4813971DBCEE14A877D9,'Frankenstein',1910,0.0,'Frankenstein is a 1910 American short silent horror film produced by Edison Studios. It was directed by J. Searle Dawley, who also wrote the one-reeler\'s screenplay, broadly basing his \"scenario\" on Mary Shelley\'s 1818 novel Frankenstein; or, The Modern Prometheus. This short motion picture is generally recognized by film historians as the first screen adaptation of Shelley\'s work. The small cast, who are not credited in the surviving 1910 print of the film, includes Augustus Phillips as Dr. Frankenstein, Charles Ogle as Frankenstein\'s monster, and Mary Fuller as the doctor\'s fiancée.','https://upload.wikimedia.org/wikipedia/commons/thumb/8/88/Frankenstein_%281910%29_poster.jpg/320px-Frankenstein_%281910%29_poster.jpg',320,413,'Frankenstein_(1910_film)'),(0x25BB5ED302E4400BAA613C696C83E980,'In Old California',1910,0.0,'In Old California is a 1910 American silent Western film. It was the first film shot in Hollywood, California. It was directed by D. W. Griffith of the American Mutoscope and Biograph Company. The film is a melodrama about the Mexican era of California.','https://upload.wikimedia.org/wikipedia/commons/thumb/a/a9/In_old_California.jpg/320px-In_old_California.jpg',320,265,'In_Old_California_(1910_film)'),(0x29E2D15CEFB344B68261284277C2AD86,'The Courtship of Miles Standish',1910,0.0,'The Courtship of Miles Standish is an 1858 narrative poem by American poet Henry Wadsworth Longfellow about the early days of Plymouth Colony, the colonial settlement established in America by the Mayflower Pilgrims.','https://upload.wikimedia.org/wikipedia/en/thumb/d/da/Courtship_of_Miles_Standish_a_Plymouth_Pilgrim.jpg/320px-Courtship_of_Miles_Standish_a_Plymouth_Pilgrim.jpg',320,461,'The_Courtship_of_Miles_Standish'),(0x2CB64B73B1F211EF8BDA0242AC120002,'Quantum Horizon',2024,5.0,'Quantum Horizon is a 2024 science fiction thriller directed by Emilia Vance. The story follows a team of scientists attempting to navigate a mysterious anomaly threatening Earth\'s existence. Starring Ava Carter, Liam Zhang, and Sophia Novak, the film explores themes of survival, sacrifice, and the unknown. It was released on July 21, 2024, by Stellar Entertainment.','https://upload.wikimedia.org/fakepath/quantum_horizon_poster.jpg',460,620,'Quantum_Horizon_(2023_film)'),(0x2D71789AF76943A1A8395F3F5C034E10,'Pocahontas',1910,0.0,'Pocahontas is a 1910 American silent short drama produced by the Thanhouser Company. The scenario was written by Lloyd Lonergan based on Lydia Sigourney\'s 1841 Pocahontas poem. The film is a retelling of the well-known story of Pocahontas, played by Anna Rosemond who saves the life of Captain John Smith, played by George Barnes. She is captured and held hostage by the English, converts to Christianity and marries Rolfe, played by Frank H. Crane. Pocahontas then sickens and dies, spending her last hours wishing to return to her native home. Released on October 11, 1910, the film was met with praise by most reviewers. It is believed that a replica of Hendrik Hudson\'s ship, Halve Maen, was used for the opening scene to establish the Jamestown landing. Though minor costuming and historical accuracy errors were pointed out, the film was praised as being of the highest quality of any Independent company. The film is presumed lost.','https://upload.wikimedia.org/wikipedia/commons/thumb/7/76/Pocahontas_1910.jpg/320px-Pocahontas_1910.jpg',320,209,'Pocahontas_(1910_film)'),(0x337C93568A3641E7B9E3F90F4D08EC0A,'The Taming of the Shrew',1908,0.0,'The Taming of the Shrew is a 1908 silent film directed by D. W. Griffith and produced by the American Mutoscope and Biograph Company of New York City. The 17-minute short, which is based on the play of the same name by English playwright William Shakespeare, was filmed in just two days–October 1 and 7, 1908–at Biograph\'s studio in Manhattan and on location in nearby Coytesville, a borough of Fort Lee, New Jersey.','https://upload.wikimedia.org/wikipedia/commons/thumb/4/48/The_Taming_of_the_Shrew_%281908%29.webm/320px--The_Taming_of_the_Shrew_%281908%29.webm.jpg',320,240,'The_Taming_of_the_Shrew_(1908_film)'),(0x40F08ABA09A94143A57361712DB87330,'A Christmas Carol',1910,0.0,'A Christmas Carol is a 1910 silent drama film directed by J. Searle Dawley and produced at Edison Studios in The Bronx in New York City. After the 1901 British release Scrooge, or, Marley\'s Ghost, this American version of Charles Dickens\' 1843 novella is the second oldest surviving screen adaptation of the famous literary work. It features Marc McDermott as Ebenezer Scrooge and Charles S. Ogle as Bob Cratchit.','https://upload.wikimedia.org/wikipedia/commons/thumb/9/9e/Film_still_of_1910_Edison_release_A_Christmas_Carol.jpeg/320px-Film_still_of_1910_Edison_release_A_Christmas_Carol.jpeg',320,235,'A_Christmas_Carol_(1910_film)'),(0x423577464C60480F8E22AFF158AD5F16,'An Arcadian Maid',1910,0.0,'An Arcadian Maid is a 1910 American silent drama film directed by D. W. Griffith and starring Mary Pickford. It was produced and distributed by the Biograph Company.','https://upload.wikimedia.org/wikipedia/commons/thumb/1/1b/An_Arcadian_Maid_1910_MARY_PICKFORD_MACK_SENNETT_D_W_Griffith_G_W_Bitzer.webm/320px--An_Arcadian_Maid_1910_MARY_PICKFORD_MACK_SENNETT_D_W_Griffith_G_W_Bitzer.webm.jpg',320,240,'An_Arcadian_Maid'),(0x4788B54F4DC544B2800C6D486A24EF1F,'Ben Hur',1907,0.0,'Ben Hur is a 1907 American silent drama film set in ancient Rome, the first screen adaptation of Lew Wallace\'s popular 1880 novel Ben-Hur: A Tale of the Christ. Co-directed by Sidney Olcott and Frank Oakes Rose, this \"photoplay\" was produced by the Kalem Company of New York City, and its scenes, including the climactic chariot race, were filmed in the city\'s borough of Brooklyn.','https://upload.wikimedia.org/wikipedia/commons/thumb/d/de/Ben_Hur_%281907%29_film..jpg/320px-Ben_Hur_%281907%29_film..jpg',320,245,'Ben_Hur_(1907_film)'),(0x58889EDDCEE84A52800353F7F2C9E941,'The House with Closed Shutters',1910,0.0,'The House with Closed Shutters is a 1910 American silent drama film directed by D. W. Griffith and released by the Biograph Company. Prints of The House with Closed Shutters exist in the film archives of the Museum of Modern Art, George Eastman House, and the Library of Congress.','https://upload.wikimedia.org/wikipedia/en/thumb/9/9e/The_House_with_Closed_Shutters.jpg/320px-The_House_with_Closed_Shutters.jpg',320,216,'The_House_with_Closed_Shutters'),(0x5BB9354346E64CD2B96AA2A5AF15204B,'Edgar Allan Poe',1909,0.0,'Edgar Allen Poe [sic] is a 1909 American silent drama film produced by the Biograph Company of New York and directed and co-written by D. W. Griffith. Herbert Yost stars in this short as the 19th-century American writer and poet Edgar Allan Poe, while Linda Arvidson portrays Poe\'s wife Virginia. When it was released in February 1909 and throughout its theatrical run, the film was consistently identified and advertised with Poe\'s middle name misspelled in its official title, using an \"e\" instead of the correct second \"a\". The short was also originally shipped to theaters on a \"split reel\", which was a single reel that accommodated more than one film. This 450-foot drama shared its reel with another Biograph short, the 558-foot comedy A Wreath in Time. Prints of both films survive.','https://upload.wikimedia.org/wikipedia/commons/thumb/a/ac/Actor_Herbert_Yost_%28left%29_as_Edgar_Allan_Poe_in_1909_Biograph_film.jpg/320px-Actor_Herbert_Yost_%28left%29_as_Edgar_Allan_Poe_in_1909_Biograph_film.jpg',320,230,'Edgar_Allan_Poe_(1909_film)'),(0x5E67B34F923642ECBD8F1ED974C5A1FF,'The Black Viper',1908,0.0,'The Black Viper is a 1908 film directed by D. W. Griffith. The film was made by the American Mutoscope and Biograph Company when it and many other early film studios in America\'s first motion picture industry were based in Fort Lee, New Jersey at the beginning of the 20th century.','https://upload.wikimedia.org/wikipedia/commons/thumb/5/5b/The_Black_Viper.webm/320px--The_Black_Viper.webm.jpg',320,240,'The_Black_Viper'),(0x6A7B52D6435D4E5D9C7ECE4AFA96FA7A,'Dr. Jekyll and Mr. Hyde',1908,0.0,'Dr. Jekyll and Mr. Hyde is a 1908 silent horror film starring Hobart Bosworth, and Betty Harte in her film debut. Directed by Otis Turner and produced by William N. Selig, this was the first film adaptation of Robert Louis Stevenson\'s 1886 novel Strange Case of Dr Jekyll and Mr Hyde. The screenplay was actually adapted by George F. Fish and Luella Forepaugh from their own 1897 four act stage play derived from the novel, causing a number of plot differences with the original source. Despite Stevenson\'s protests, this film became the model which influenced all the later film adaptations that were to come.','https://upload.wikimedia.org/wikipedia/commons/thumb/e/ed/Dr_Jekyll_and_Mr_Hyde_1908_newspaper.jpg/320px-Dr_Jekyll_and_Mr_Hyde_1908_newspaper.jpg',320,204,'Dr._Jekyll_and_Mr._Hyde_(1908_film)'),(0x75F6BA6AB41311EF8D310242AC120002,'Quantum Horizon 3',2024,5.0,'Quantum Horizon is a 2024 science fiction thriller directed by Emilia Vance. The story follows a team of scientists attempting to navigate a mysterious anomaly threatening Earth\'s existence. Starring Ava Carter, Liam Zhang, and Sophia Novak, the film explores themes of survival, sacrifice, and the unknown. It was released on July 21, 2024, by Stellar Entertainment.','https://upload.wikimedia.org/fakepath/quantum_horizon_poster.jpg',450,600,'Quantum_Horizon_3_(2024_film)'),(0x7789CB2150E94DF98C720AA927A6014D,'The Fugitive',1910,0.0,'The Fugitive is a 1910 American drama film directed by D. W. Griffith. Prints of the film survive at the film archive of the Library of Congress and at George Eastman House. The script was by John MacDonagh, who would later fight in the Easter Rising under the command of his brother, Thomas MacDonagh, one of the seven signatories of the Proclamation of the Irish Republic, who would be executed by the British along with 15 other leaders after the Rising.','https://upload.wikimedia.org/wikipedia/commons/thumb/2/20/The_Fugitive_1910.webm/320px--The_Fugitive_1910.webm.jpg',320,234,'The_Fugitive_(1910_film)'),(0x798765E87159431D89D9903380B2D71D,'A Calamitous Elopement',1908,0.0,'A Calamitous Elopement is a 1908 American silent short comedy film directed by D. W. Griffith. A print of the film is preserved in the film archive of the Library of Congress.','https://upload.wikimedia.org/wikipedia/commons/thumb/8/89/A_Calamitous_Elopement.webm/320px--A_Calamitous_Elopement.webm.jpg',320,240,'A_Calamitous_Elopement'),(0x82FA536B9F3A46BD990B9EC1044A0D56,'The Curtain Pole[1]',1909,0.0,'The Curtain Pole is a 1909 American comedy film directed by D. W. Griffith. A print of the film still exists. The film was made by the American Mutoscope and Biograph Company when it and many other early film studios in America\'s first motion picture industry were based in Fort Lee, New Jersey at the beginning of the 20th century.','https://upload.wikimedia.org/wikipedia/commons/thumb/7/7b/The_Curtain_Pole.webm/320px--The_Curtain_Pole.webm.jpg',320,240,'The_Curtain_Pole'),(0x8FA6D25B66044249AE1DC3EE61E6DD4E,'Ramona',1910,0.0,'Ramona is a 1910 American short drama film directed by D. W. Griffith, based on Helen Hunt Jackson\'s 1884 novel Ramona. Through a love story, the early silent short explores racial injustice to Native Americans and stars Mary Pickford and Henry B. Walthall. A copy of the print survives in the Library of Congress film archive. The film was remade in 1928 with Dolores del Río and 1936 with Loretta Young.','https://upload.wikimedia.org/wikipedia/commons/thumb/d/de/Ramona_%281910%29.webm/320px--Ramona_%281910%29.webm.jpg',320,240,'Ramona_(1910_film)'),(0x93D2CEFB8B5848BF82C9BE0E4C910237,'The Adventures of Dollie',1908,0.0,'The Adventures of Dollie is a 1908 American silent drama film directed by D. W. Griffith. It was Griffith\'s debut film as a director. A print of the film survives in the Library of Congress film archive. The film tells the story of a young girl who, after being kidnapped by a peddler, ends up trapped in a barrel as it floats downriver toward a waterfall.','https://upload.wikimedia.org/wikipedia/commons/thumb/2/2e/The_adventures_of_Dollie.webm/320px--The_adventures_of_Dollie.webm.jpg',320,240,'The_Adventures_of_Dollie'),(0x9E811278F1CF4A94B67DF9882198E9D9,'In the Border States',1910,0.0,'In the Border States is a 1910 American drama film directed by D. W. Griffith. Prints of the film survive in the film archives of the Museum of Modern Art and the Library of Congress.','https://upload.wikimedia.org/wikipedia/commons/thumb/2/2c/In_the_Border_States_%281910%29.webm/320px--In_the_Border_States_%281910%29.webm.jpg',320,240,'In_the_Border_States'),(0xBB25B20D06A644E59770DAB55F4F6AD5,'The Lad from Old Ireland',1910,0.0,'The Lad from Old Ireland, also called A Lad from Old Ireland, is a one-reel 1910 American motion picture directed by and starring Sidney Olcott and written by and co-starring Gene Gauntier. It was the first film appearance of prolific actor/director J.P. McGowan.','https://upload.wikimedia.org/wikipedia/commons/thumb/f/f9/2.-Lad-from-Old-Ireland-advert-.jpg/320px-2.-Lad-from-Old-Ireland-advert-.jpg',320,434,'The_Lad_from_Old_Ireland'),(0xBC0AE9BADF784141A51603CA09C46381,'The Automobile Thieves',1906,0.0,'The Automobile Thieves is an American crime-drama silent film directed by J. Stuart Blackton. The picture stars Blackton and Florence Lawrence. It was released on November 10, 1906 by The American Vitagraph Company; a print of the feature is preserved in the UCLA Film and Television Archive.','https://upload.wikimedia.org/wikipedia/commons/thumb/a/aa/Advertisement_for_silent_film_The_Automobile_Thieves_in_newspaper%2C_The_New_York_Clipper.jpg/320px-Advertisement_for_silent_film_The_Automobile_Thieves_in_newspaper%2C_The_New_York_Clipper.jpg',320,496,'The_Automobile_Thieves'),(0xC384E58121E74058AB60C9BFA747D96F,'Money Mad',1908,0.0,'Money Mad is a 1908 American short crime film directed by D. W. Griffith. It is based on the short story \"Just Meat\" by Jack London.','https://upload.wikimedia.org/wikipedia/commons/thumb/f/f2/Money_Mad_%281908%29.webm/320px--Money_Mad_%281908%29.webm.jpg',320,240,'Money_Mad_(1908_film)'),(0xD411B169AD6F4F6F83DE9163A79E5418,'Alice in Wonderland',1903,0.0,'Alice in Wonderland is a 1903 British silent fantasy film directed by Cecil Hepworth and Percy Stow. Only one copy of the original film is known to exist. The British Film Institute (BFI) partially restored the movie and its original film tinting and released it in 2010. According to BFI, the original film ran about 12 minutes; the restoration runs 9 minutes and 35 seconds. At the beginning of the restoration, it states that this is the first movie adaptation of Lewis Carroll\'s 1865 children\'s book Alice\'s Adventures in Wonderland. It was filmed mostly at Port Meadow in Oxford.','https://upload.wikimedia.org/wikipedia/commons/thumb/9/9a/Norman_Whitten_Mad_Hatter_1903.jpg/320px-Norman_Whitten_Mad_Hatter_1903.jpg',320,202,'Alice_in_Wonderland_(1903_film)'),(0xD7D97CEA6EEA4B469652FB19FED743C6,'The Call of the Wild',1908,0.0,'The Call of the Wild is a 1908 American short silent Western film directed by D. W. Griffith and produced by the American Mutoscope and Biograph Company. The short, a \"one-reeler\", stars Charles Inslee, Harry Solter and Florence Lawrence. Its interior scenes were shot at Biograph\'s studio facilities in New York City, and its exteriors were filmed on location in Coytesville, today one of the oldest communities in Fort Lee, New Jersey.','https://upload.wikimedia.org/wikipedia/commons/thumb/9/90/Screenshot_of_digital_copy_of_the_1908_film_The_Call_of_the_Wild.jpg/320px-Screenshot_of_digital_copy_of_the_1908_film_The_Call_of_the_Wild.jpg',320,228,'The_Call_of_the_Wild_(1908_film)'),(0xDAA28B07A7554436808DB25ECD6F4B8D,'Those Awful Hats',1909,0.0,'Those Awful Hats is a 1909 American short comedy film directed by D.W. Griffith and starring Mack Sennett. It takes place in a small, crowded movie theatre, where the patrons are perpetually distracted by people - primarily women - wearing large, ostentatious hats that obstruct everyone else\'s views of the screen. Slapstick disorder ensues. The film ends with a title card reading, \"Ladies Will Please Remove Their Hats.\" A print of the film survives in the film archive of the Library of Congress.','https://upload.wikimedia.org/wikipedia/commons/thumb/2/24/Those_Awful_Hats.webm/320px--Those_Awful_Hats.webm.jpg',320,240,'Those_Awful_Hats'),(0xE34C366EB29111EF945C0242AC120002,'Quantum Horizon',2023,5.0,'Quantum Horizon is a 2024 science fiction thriller directed by Emilia Vance. The story follows a team of scientists attempting to navigate a mysterious anomaly threatening Earth\'s existence. Starring Ava Carter, Liam Zhang, and Sophia Novak, the film explores themes of survival, sacrifice, and the unknown. It was released on July 21, 2024, by Stellar Entertainment.','https://upload.wikimedia.org/fakepath/quantum_horizon_poster.jpg',450,600,'Quantum_Horizon_(2023_film)'),(0xE5F1A7DD069B479C97BE00110D602EAA,'Humorous Phases of Funny Faces',1906,0.0,'Humorous Phases of Funny Faces is a 1906 short silent animated cartoon directed by James Stuart Blackton and generally regarded by film historians as the first animated film recorded on standard picture film.','https://upload.wikimedia.org/wikipedia/commons/thumb/4/4f/Humorous_Phases_of_Funny_Faces.ogv/320px--Humorous_Phases_of_Funny_Faces.ogv.jpg',320,240,'Humorous_Phases_of_Funny_Faces'),(0xF1A95A4E56EA4E2ABD3BAC8D3404DCDA,'Romeo and Juliet',1908,0.0,'The first American film version of William Shakespeare\'s Romeo and Juliet was a silent film short made in 1908 made by Vitagraph Studios. Directed by J. Stuart Blackton, it was filmed at Bethesda Terrace in Manhattan, New York.','https://upload.wikimedia.org/wikipedia/commons/thumb/5/51/Romeo_and_Juliet_%281908%29_-_A_Pictorial_History_of_the_Movies.jpg/320px-Romeo_and_Juliet_%281908%29_-_A_Pictorial_History_of_the_Movies.jpg',320,242,'Romeo_and_Juliet_(1908_film)'),(0xFD5D9461CB564585B5D8CE558A68E3B0,'A Drunkard\'s Reformation',1909,0.0,'A Drunkard\'s Reformation is a 1909 American drama film directed by D. W. Griffith. Prints of the film survive in the film archive of the Library of Congress. The 	American Mutoscope and Biograph Company advertised the feature as \"The most powerful temperance lecture ever depicted\".','https://upload.wikimedia.org/wikipedia/en/thumb/7/7b/Opening_credits_from_silent_film_A_Drunkard%27s_Reformation_%281909%29.jpg/320px-Opening_credits_from_silent_film_A_Drunkard%27s_Reformation_%281909%29.jpg',320,238,'A_Drunkard%27s_Reformation'),(0xFE6406A5DA014299AFCE2B97A5506D84,'Balked at the Altar',1908,0.0,'Balked at the Altar is a 1908 American short comedy film directed by D. W. Griffith. A print of the film survives in the film archive of the Library of Congress. The film was made by the American Mutoscope and Biograph Company when it and many other early film studios in America\'s first motion picture industry were based in Fort Lee, New Jersey at the beginning of the 20th century.','https://upload.wikimedia.org/wikipedia/commons/thumb/c/ca/Balked_at_the_Altar_%281908%29.webm/320px--Balked_at_the_Altar_%281908%29.webm.jpg',320,240,'Balked_at_the_Altar');
